const baseUrl = 'https://strangers-things.herokuapp.com'
const key = ''
console.log('hello')

async function fetchPosts() {
    try {
        const result = await fetch(baseUrl)
        const data = await result.json()
        console.log(data);
    } catch (err) {
        console.error(err)
    } finally {
        console.log("do stuff whether or not an error happened")
    }
}
